import React from "react";
import "./Card.css";

const Card = ({emoji, heading, detail, color ,btn}) => {
  return (
    <div className="card" style={{borderColor: {color}}}> 
      <img src={emoji} alt="" />
      <span>{heading}</span>
      <span>{detail}</span>
{btn ? <button className="c-button">{btn}</button>:''}
    </div>
  );
};

export default Card;
